    false,nt"url": null,nt"notes": "This report summarizes the monitoring of
    populations and production of tundra swans on Selawik National Wildlife Refuge in
    1985 as part of a long-term study. Radio telemetry was used to determine the local
    movements of the swans. Objectives of the study were to: determine trends in tundra
    swan populations and habitat use, and examine patterns of local movements to define
    the size of habitat areas needed by various age and geographic groups of the population.
    The methods used and a discussion of the results are included.",nt"license_title":
